import React from "react";
import { Route, Switch} from "react-router-dom";

import SignIn from '../pages/SignIn.js';
import Profile from '../pages/Profile.js';
import Home from '../pages/Home.js';
import Kategori from '../pages/kategori.js';
import Produk from '../pages/Produk.js'

const MainRoute = () => {
    return ( 
        <Switch>
            <Route exact path="/home" component={Home} />
            <Route exact path="/:KATEGORI" component={Kategori} />
            {/* <Route exact path="/signin" component={SignIn} />
            <Route exact path="/romance" component={romance} />
            <Route exact path="/action" component={action} />
            <Route exact path="/fiction" component={fiction} />
            <Route exact path="/comedy" component={comedy} />
            <Route exact path="/profile" component={Profile} /> */}
            <Route exact path="/:ID" component={Produk} />
        </Switch>
    );
};

export default MainRoute;
